import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 10.5,
      date: new Date(2022, 9, 26),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 1250,
      date: new Date(2022, 9, 26),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.56,
      date: new Date(2022, 9, 26),
    },
    {
      id: "e4",
      title: "Yoga",
      amount: 100,
      date: new Date(2022, 9, 26),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
